                "icon": "http://www.gstatic.com/mapspro/images/stock/503-wht-blank_maps.png",
                "description": "Municipio: Pozo de Urama<br>Localidad: Pozo de Urama<br>Tipo: Inmueble<br>Recurso: Iglesia Parroquial de Nuestra Señora del Castillo<br>Email: <br>Telefono: <br>Descripción: Fue construida en el segundo tercio del siglo XVII a bese de ladrillo. Su interior se divide entres naves conformadas por pilares que soporten sus cercos de medio punto. La cubierta es plana y dispone de un artesonado rústico de madera. A los pies de la iglesia se levanta una espadaña compuesta de dos cuerpos, también construida en ladrillo. En la nave del evangelio se conserva un retablo barroco del primer cuarto del siglo XVII con diversas pinturas sobre tablas de esa misma época y que representan a la Anunciación, el Nacimiento y Cristo con los doctores. Dispone asimismo de una Virgen gótica del siglo XIII. En esta misma nave, otro retablo, éste rococó de mediados del siglo XVIII. En el presbiterio sobresale el retablo mayor de los años finales del siglo XVII con algunos relieves alusivos a la Anunciación, el Nacimiento, Presentación en el templo, Circuncisión y una escultura de la Inmaculada. En la nave de la epístola, se mantiene el retablo barroco de los años finales del siglo XVII con una escultura gótica de la Virgen del siglo XIII. Otro retablo más, también barroco, del primer cuarto del siglo XVII, conserva una escultura de San Antón y un relieve de la Asunción. En la Santería, una Cruz parroquial de plata de un taller vallisoletano y de finales del siglo XVII.<br>Enlace Google: https://goo.gl/maps/zK9XY77krBm<br>Otros ennlaces: <br>Observaciones: <br>Subtipo: Edificio Religioso<br>Classificado?: <br>Dirección: ",
