                "description": "Municipio: Castrillo del Val<br>Localidad: Castrillo del Val<br>Tipo: Inmueble<br>Recurso: Monasterio de San Pedro de Cardeña<br>Subtipo: Edificio Religioso<br>Clasificado?: Sí<br>Dirección: <br>Telefono: <br>Descripción: Su origen no puede precisarse con exactitud, aunque algunos autores sitúan su nacimiento en época visigótica. A finales del siglo IX, el monasterio estaba perfectamente consolidado. Fue en esos momentos cuando la tradición sitúa el martirio de 200 monjes a manos de los musulmanes. El monasterio es célebre por su relación literaria con el Cid Campeador, quien, según el Cantar de Mio Cid, al iniciar su destierro, en el año 1081, dejó a su esposa y a sus dos hijas bajo la protección del abad Sisebuto y de sus monjes. Allí encontraron reposo los restos mortales del Cid y de su esposa doña Jimena hasta 1836, salvo un breve periodo intermedio en que fueron llevados a Burgos. En 1836, tras la exclaustración de los monjes, fueron trasladados a la Casa Consistorial de Burgos, donde descansaron hasta 1921, momento en que fueron solemnemente trasladados a la Catedral. En los siglos XI y XII el monasterio vivió una de su épocas más brillantes, convirtiéndose en un importante centro difusor de cultura a través de su famoso Scriptorium. En las centurias siguientes sufrió una larga etapa de decadencia, que se superó a partir de principios del siglo XVI tras su vinculación a la Congregación de San Benito de Valladolid.<br>Enlace Google: https://goo.gl/maps/TzXxQK4hrrs<br>Otros ennlaces: <br>Observaciones: <br>Gestión: <br>Email: <br>Propiedad: <br>Rural/Urbano: ",
