                "description": "Municipio: Castrojeriz<br>Localidad: Castrojeriz<br>Tipo: Inmueble<br>Recurso: Iglesia de Nuestra Señora del Manzano<br>Subtipo: <br>Clasificado?: Sí<br>Dirección: <br>Telefono: <br>Descripción: El edificio actual comenzó a construirse en el año 1214, según los cánones del estilo románico-ojival, gótico de transición, por voluntad de la reina Berenguela de Castilla, hija de Alfonso VIII de Castilla y madre de Fernando III el Santo. Se encuentra al pie del cerro en el que se halla el castillo de Castrojeriz, y ostentó en el pasado el rango de colegiata. En el s. XV todas sus bóvedas son cambiadas al gusto gótico. La reforma más profunda se hizo en el s. XVIII, con la construcción de la capilla de la Virgen del Manzano, la cripta para enterramiento de los condes, un nuevo ábside y la elevación de la torre. Alberga un museo de objetos relacionados con el culto cristiano. Se pueden apreciar multitud figuras de madera, alguna de ellas tallada en el siglo XIV. También expone, cuadros, libros, cálices, y otros objetos. La visita está sobre todo enfocada a los peregrinos que realizan el Camino de Santiago y pasan por delante de sus puertas.<br>Enlace Google: https://goo.gl/maps/r9DxvLyJbVH2<br>Otros ennlaces: <br>Observaciones: <br>Gestión: <br>Email: <br>Propiedad: <br>Rural/Urbano: ",
