                "description": "Municipio: Mansilla Mayor<br>Localidad: Villaverde de Sandoval<br>Recurso: Monasterio de Santa María de Sandoval<br>Tipo: Inmueble<br>Subtipo: Edificio Religioso<br>Enlace Google: https://goo.gl/maps/Gi83veFkjwE2<br>Otros ennlaces: <br>Email: <br>Telefono: <br>Descripción: Se construyó sobre terrenos donados en 1142 por Alfonso VII al conde Pedro Ponce de Minerva y a su esposa Estefanía Ramírez. En 1167, el mismo conde los cedió a los monjes del monasterio vallisoletano de la Espina, para que allí construyeran otro. Las obras debieron iniciarse a finales del siglo XII. Después de recibir numerosas donaciones y ser poseedor de amplios territorios, entró en decadencia en el siglo XV. En 1592 y 1615 fue pasto de las llamas, razón por la que hubo de reedificarse. La permanencia de los monjes se mantuvo hasta 1835, fecha en la que se produjo el exclaustrado con la desamortización de Mendizábal. Su disposición arquitectónica responde al indicado por la Regla del Cister. Posee dos grandes claustros, aunque el que se conserva es el realizado en el siglo XVII. En él se mantiene la severidad de la Sala Capitular. La iglesia es de planta de cruz latina, con tres naves, crucero y ábsides semicirculares. La primitiva puerta de acceso por el hastial norte, es románica, y presenta una singular resolución de sus arquivoltas. La del oeste, que es ahora la de entrada, es de arco apuntado, sobresaliendo su belleza por la sencillez de su construcción y elementos decorativos a base de elementos florales, figuras de monjes y el calvario del tímpano de la puerta. En el hastial sur se levanta la espadaña que es de tiempos posteriores. En su interior destacan los sarcófagos de los fundadores, dispuestos a ambos lados del altar. En el medio se montó el retablo mayor en el que participó entre 1605 y 1618 Pedro Sánchez, monje cisterciense. Es interesante el retablillo del trasaltar, obra del siglo XVII, donde se instalaron una sucesión de bustos relicario. Entre las imágenes más significadas que alberga la iglesia, tenemos la de Ntra. Sra. De Sandoval, escultura del siglo XII que hoy se custodia en el Palacio Episcopal de León; la de San Geroteo, del siglo XVII; el retablo de la Concepción en la capilla lateral derecha; la imagen de Santiago Peregrino, del siglo XVII, y la imagen de vestir de San Bernardo, que es el santo patrono del pueblo.<br>Observaciones: <br>Clasificado?: Sí<br>Rural/Urbano: <br>Propiedad: <br>Gestión: <br>Uso: <br>Dirección: ",
