                "Descripción": "Fue convento de franciscanos del que solo quedan restos. Su fundación data de 1213, atribuyendose a la reina Doña Urraca. En sus orígenes tuvo otra ubicación en el antiguo hospital localizado en la zona ocupada por el Convento de la Anunciada. Posteriormente hacia 1285 se traslada a su actual ubicación. De aquel convento solo se conserva la Iglesia como única edificación, que se trata de un templo de estilo Románico-Gótico. La parte más antigua es la que corresponde a la portada de acceso de estilo románico tardío. El segundo cuerpo de la fachada y las torres del campanario corresponden al barroco, s. XVII. La ampliación de la Iglesia se lleva a cabo en la segunda mitad del s. XV, en estilo gótico.",
